NUTOOL_PIN.decidepackageNumber = function (given_partNumber_package) {
    var partNumber_package,
        partNumber;

    if (typeof given_partNumber_package === 'undefined') {
        partNumber_package = NUTOOL_PIN.getg_partNumber_package();
    }
    else {
        partNumber_package = given_partNumber_package;
    }

    NUTOOL_PIN.g_packageNumber = partNumber_package.substring(partNumber_package.indexOf('(') + 1);
    NUTOOL_PIN.g_packageNumber = NUTOOL_PIN.g_packageNumber.substring(0, NUTOOL_PIN.g_packageNumber.indexOf(')'));

    partNumber = partNumber_package.substring(0, partNumber_package.indexOf('('));
    switch (NUTOOL_PIN.g_packageNumber) {
    case 'QFN33':
        NUTOOL_PIN.g_packageNumberIndex = "UQFN33(USB1.1)(4*4)";
        break;
    case 'QFN48':
        NUTOOL_PIN.g_packageNumberIndex = "UQFN48(USB1.1)(7*7)";
        break;
    case 'LQFP48':
        NUTOOL_PIN.g_packageNumberIndex = "ULQFP48(USB1.1)(7*7)";
        break;
    case 'LQFP64':
        NUTOOL_PIN.g_packageNumberIndex = "ULQFP64(USB1.1)(7*7)";
        break;
    case 'LQFP128':
        NUTOOL_PIN.g_packageNumberIndex = "ULQFP128(USB1.1)(14*14)";
        break;
    }
    partNumber_package = null;
    partNumber = null;
};
